[{"location":"#SeeSign","page":"Home","title":"SeeSign","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for SeeSign.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#SeeSign.StepArray","page":"Home","title":"SeeSign.StepArray","text":"StepArray(arr)\n\nYou have an array and want to compare the current value with the previous value. This creates a double of the array so that memory use is optimized.\n\n\n\n\n\n","category":"type"},{"location":"#SeeSign.TrackedVector","page":"Home","title":"SeeSign.TrackedVector","text":"TrackedVector{T}\n\nA vector that tracks access and changes to its elements.\n\n\n\n\n\n","category":"type"},{"location":"#Base.iterate","page":"Home","title":"Base.iterate","text":"iterate(arr::StepArray, [state])\n\nEnables iteration over a StepArray, allowing it to be used in for loops and with other iteration functions like map, filter, etc.\n\n\n\n\n\n","category":"function"},{"location":"#SeeSign.accept-Tuple{SeeSign.PhysicalState}","page":"Home","title":"SeeSign.accept","text":"The arrays in a PhysicalState record that they have been modified. This function erases the record of modifications.\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.change-Tuple{Any}","page":"Home","title":"SeeSign.change","text":"change(obj)\n\nReturns the set of fields that have been modified. Alias for changed().\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.changed-Tuple{SeeSign.PhysicalState}","page":"Home","title":"SeeSign.changed","text":"Return a list of changed places in the physical state. A place for this state is a tuple of a symbol and the Cartesian index. The symbol is the name of the array within the PhysicalState.\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.changed-Tuple{StepArray}","page":"Home","title":"SeeSign.changed","text":"changed(arr::StepArray)\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.changed-Tuple{TrackedVector}","page":"Home","title":"SeeSign.changed","text":"changed(obj)\n\nReturns the set of fields that have been modified.\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.deal_with_changes-Tuple{SeeSign.SimulationFSM}","page":"Home","title":"SeeSign.deal_with_changes","text":"deal_with_changes(sim::SimulationFSM)\n\nAn event changed the state. This function modifies events to respond to changes in state.\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.gotten-Tuple{TrackedVector}","page":"Home","title":"SeeSign.gotten","text":"gotten(obj)\n\nReturns the set of fields that have been accessed.\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.isadjacent-Tuple{SeeSign.PhysicalState, Any, Any}","page":"Home","title":"SeeSign.isadjacent","text":"Whether two individuals are adjacent.\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.move_generate_event-Tuple{Any, Any}","page":"Home","title":"SeeSign.move_generate_event","text":"A dynamic generator of events. This looks at a changed place in the  physical state and generates clock keys for events that could depend on that place.\n\n@when agentat(loc) && available(loc+direction) => (:move, loc, direction)\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.previous_value-Tuple{StepArray, Vararg{Any}}","page":"Home","title":"SeeSign.previous_value","text":"previous_value(arr::StepArray, i...)\n\nGet the previous value at index i before it was changed. Returns the current value if the element hasn't been changed.\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.reset_gotten!-Tuple{TrackedVector}","page":"Home","title":"SeeSign.reset_gotten!","text":"reset_gotten!(obj)\n\nReset the tracking of accessed fields.\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.reset_tracking!-Tuple{TrackedVector}","page":"Home","title":"SeeSign.reset_tracking!","text":"reset_tracking!(obj)\n\nReset all tracking information.\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.track_assignments-Tuple{Function}","page":"Home","title":"SeeSign.track_assignments","text":"track_assignments(f::Function)\n\nThis function takes a function f that returns nothing and creates a new function that returns a list of the indices of the elements that are assigned to in f.\n\nIt uses code introspection to analyze the function for array assignments without having to execute it with a proxy object.\n\n\n\n\n\n","category":"method"},{"location":"#SeeSign.@tracked_struct-Tuple{Any, Any}","page":"Home","title":"SeeSign.@tracked_struct","text":"@tracked_struct Name begin\n    field1::Type1\n    field2::Type2\n    # ...\nend\n\nCreates a struct that tracks when its fields are accessed or modified.\n\n\n\n\n\n","category":"macro"}]
